import React from 'react';
import './App.css';
import Navbar from './Components/Navbar';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

import Home from './Components/pages/Home';
import PersonL from './Components/pages/PersonL';
import PersonInput from './Components/PersonInput';
import PersonPut from './Components/PersonPut';

function App() {
  return (

      <>
      <Router>

      <Navbar />

        <Switch>
      <Route path='/Home' exact component={Home}/>
      <Route path='/PersonL' exact component={PersonL}/>
      <Route path='/PersonInput' exact component={PersonInput}/>
      <Route path='/PersonPut' exact component={PersonPut}/>


      </Switch>
      </Router>

   </>
  );
}

export default App;
